def react(x: str) -> str:
    """
    Runs a reaction until no more reactions are possible, which will result in the same string or a shorter one
    """
    i = 0
    next_trigger = None

    while i < len(x):
        c = x[i]
        if c == next_trigger:
            x = f'{x[:i-1]}{x[i+1:]}'
            if not x:
                return ''
            # backtrack for new trigger
            i -= 2
            next_trigger = None
            continue
        if c.isupper():
            next_trigger = c.lower()
        else:
            next_trigger = c.upper()
        i += 1

    return x


